INSERT INTO `presentacion` (`id`, `title`, `content`, `created_at`, `updated_at`) VALUES
(1, 'Normativa para la Infraestructura del Transporte NIT-SICT', '[\"La Normativa para la Infraestructura del Transporte (Normativa SICT), es el conjunto de criterios, m\\u00e9todos y procedimientos para la correcta ejecuci\\u00f3n de los trabajos que realiza la Secretar\\u00eda de Infraestructura, Comunicaciones y Transportes para la infraestructura del transporte.\",\"Las Normas, Manuales y Pr\\u00e1cticas Recomendables que integran la Normativa SICT, se publican y difunden en la medida en que se elaboran o actualizan; en el momento de su publicaci\\u00f3n derogan, en lo que corresponda, a los publicados anteriormente.\",\"Los criterios, m\\u00e9todos y procedimientos contenidos en la Normativa SICT son una gu\\u00eda para efectuar la planeaci\\u00f3n, licitaci\\u00f3n, adjudicaci\\u00f3n, contrataci\\u00f3n, ejecuci\\u00f3n, supervisi\\u00f3n y, en su caso, operaci\\u00f3n y mitigaci\\u00f3n del impacto ambiental de las obras p\\u00fablicas y servicios relacionados con las mismas, as\\u00ed como para la concesi\\u00f3n de la infraestructura, de manera que, si el ingeniero considera que dichos criterios, m\\u00e9todos y procedimientos no son aplicables para la realizaci\\u00f3n de un trabajo espec\\u00edfico, puede proponer otros que no est\\u00e9n contenidos en la Normativa SICT, siempre y cuando est\\u00e9n debidamente sustentados, no contravengan las leyes federales aplicables y sean aprobados por las Autoridades competentes.\"]', '2024-10-14 22:31:50', '2025-02-06 17:24:58');
